// Home.js
import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
    return (
        <div className="dark:bg-theme-dark-background text-theme-light-text dark:text-theme-dark-text h-screen w-full overflow-hidden">
            <div className="text-4xl font-bold pt-12 pl-12">Home</div>
            <div className="grid grid-cols-4 gap-4 w-full h-full p-12" style={{height: 'calc(100vh - 3rem - 3rem)'}}> {/* Adjusted height calculation */}
                <div className="col-span-1 flex flex-col justify-center items-center bg-gray-200 dark:bg-gray-700 p-4 rounded-lg border border-white min-h-0"> {/* Added min-h-0 */}
                    <Link to="/techniques" className="text-xl font-bold">Techniques</Link>
                </div>
                <div className="col-span-1 flex flex-col justify-center items-center bg-gray-200 dark:bg-gray-700 p-4 rounded-lg border border-white min-h-0">
                    <Link to="/project-history" className="text-xl font-bold">Project History</Link>
                </div>
                <div className="col-span-1 flex flex-col justify-center items-center bg-gray-200 dark:bg-gray-700 p-4 rounded-lg border border-white min-h-0">
                    <Link to="/materials" className="text-xl font-bold">Materials</Link>
                </div>
                <div className="col-span-1 flex flex-col justify-center items-center bg-gray-200 dark:bg-gray-700 p-4 rounded-lg border border-white min-h-0">
                    <Link to="/interest-board" className="text-xl font-bold">Interest Board</Link>
                </div>

            </div>
        </div>
      );
};

export default Home;
